import React from 'react'

export default function Waiting() {
    return (
        <div style={{
            height: "100vh",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            backgroundColor: "#1f1f1f",
        }}>
            <h1 style={{
                color: "white",
                fontSize: "50px",
                fontWeight: "bold",
            }}>Collecting ...</h1>
        </div>
    );
}
